window.bookSummaryJSON = "<p><i>Renegade Star: Publisher's Pack 2</i> contains books 3 and 4 of the Renegade Star series.</p> <p><i>Renegade Moon</i>, Book 3</p> <p>A Renegade never surrenders.</p> <p>After evading both the Union and the Sarkonian Empire, Jace and the crew are off in search of Earth. With the help of Titan, their new base of operations, Jace believes they might just have a chance. That is, if they can outrun the two armies at their backs, and somehow manage to survive a galaxy that wants them dead. Not exactly a walk in the park. But no one ever said being a Renegade was easy.</p> <p><i>Renegade Lost</i>, Book 4</p> <p>A lost ship. An unknown civilization.</p> <p><i>The Renegade Star </i>is stranded, its engines totally shot, surrounded by the unknown. Floating in the dead of space, they receive a strange transmission from a nearby planet, warning them to stay away or face the consequences.</p> <p>When the message mentions how this world belongs to Earth, the lost cradle of humanity, Captain Jace Hughes knows he has no choice but to investigate. With an endless snowstorm, bloodthirsty animals around every corner, and no sign of any colonies or people, the mission won't be an easy one.</p> <p>Good thing they sent in the Renegade.</p> <p>Warning: This book contains action, cussing, and general badassery. Listen at your own risk.</p>"; 
